import React from "react";
import { FaSearch } from "react-icons/fa"; // Importing a search icon

function AssetSearchBar() { 
  return (
    <div style={{ 
        width: "335px", 
        height: "44px", 
        flexShrink: 0, 
        borderRadius: "6px", 
        border: "1px solid #9A93B3", 
        background: "#FEFEFE",
        display: "flex",
        alignItems: "center", 
        padding: "0 8px" 
    }}>
      <FaSearch style={{ display: "flex", width: "24.484px", height: "22px", justifyContent: "center", alignItems: "center", flexShrink: 0, marginRight: "8px", color: "#ccc" }} />
      <input
        type="text"
        placeholder="Search for Assets"
        style={{ 
            color:"#787486",
            fontFamily: "Inter", 
            fontSize: "14px",    
            fontStyle: "normal", 
            fontWeight: "400",   
            lineHeight: "normal",
            border: "none", 
            outline: "none", 
            width: "100%" 
        }}
      />
    </div>
  );
}

export default AssetSearchBar;
